(require '[loom.graph :as lg])
(use 'loom-gorilla.render)
(use '(gorilla-repl table latex))
(use 'clojure.core.matrix)
(use 'clojure.core.matrix.operators)
(require '[clojure.core.matrix.linear :as linear])
(require '[clatrix.core :as clatrix])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(set-current-implementation :clatrix)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-keyword'>:clatrix</span>","value":":clatrix"}
;; <=

;; @@
(defn r-node [] (keyword (str (rand-int 100))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/r-node</span>","value":"#'user/r-node"}
;; <=

;; @@
(defn r-edge [] [(r-node) (r-node) (rand-int 20)])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/r-edge</span>","value":"#'user/r-edge"}
;; <=

;; @@
(defn r-wdg [] (apply lg/weighted-graph (repeatedly 150 r-edge)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/r-wdg</span>","value":"#'user/r-wdg"}
;; <=

;; @@
(def g (r-wdg))
