(defn ->adj-matrix [g]
  (let [n (->> g 
               :nodeset 
               (map #(-> % name read-string))
               (apply max)
               inc)
        m (clatrix/zeros n n)]
    ;;(println "size" n)
    (doseq [[node edges] (:adj g)]
      (let [n1 (-> node name read-string)]
 ;;     (println "node" n1)
      (doseq [[node-key w] edges]
        (let [n2 (-> node-key name read-string)]
          ;;(println "-e" n1 n2 w)
          (clatrix/set m n1 n2 w)
          )
        )
        )
      )
    m
    ))

(def m (->adj-matrix g))
